class DecamelizePipe {
    transform(value, separator) {
        const sep = separator ? separator : ' ';
        return value
            .charAt(0).toUpperCase() + value.slice(1)
            .replace(/([a-z\d])([A-Z])/g, '$1' + sep + '$2')
            .replace(/([A-Z]+)([A-Z][a-z\d]+)/g, '$1' + sep + '$2');
    }
}
