let BROWSER_FAVICONS_CONFIG = new InjectionToken('Favicons Configuration');
/**
 * Abstract class that acts as both interface for implementation and as the dependency-injection
 */
class FaviconsService {
}
/**
 * Provide the browser-oriented implementation of the Favicons class
 */
class BrowserFavicons {
    /**
     * initialize the Favicons service.
     */
    constructor(config) {
        this.elementId = 'favicons-service-injected-node';
        this.icons = Object.assign(Object.create(null), config.icons);
        this.useCacheBusting = (config.cacheBusting || false);
        // Since the document may have a static favicon definition, we want to strip out
        // any exisitng elements that are attempting to define a favicon. This way, there
        // is only one favicon element on the page at a time.
        this.removeExternalLinkElements();
    }
    /**
     * Active favicon with given identifier
     *
     * @param name favicon name
     */
    activate(name) {
        if (!this.icons[name]) {
            throw (new Error(`Favicon for [ ${name} ] not found.`));
        }
        this.setNode(this.icons[name].type, this.icons[name].href);
    }
    /**
     * Activate the default favicon (with isDefault set to True)
     */
    reset() {
        for (const name of Object.keys(this.icons)) {
            const icon = this.icons[name];
            if (icon.isDefault) {
                this.setNode(icon.type, icon.href);
                return;
            }
        }
        // If we made it this far, none of the favicons were flagged as default. In that
        // case, let's just remove the favicon node altogether.
        this.removeNode();
    }
    /**
     * Inject the favicon element into the document header
     *
     * @param type type of icon (.png, .jpeg, etc)
     *
     * @param href location
     */
    addNode(type, href) {
        const linkElement = document.createElement('link');
        linkElement.setAttribute('id', this.elementId);
        linkElement.setAttribute('rel', 'icon');
        linkElement.setAttribute('type', type);
        linkElement.setAttribute('href', href);
        document.head.appendChild(linkElement);
    }
    /**
     * Return an augmented HREF value with a cache-busting query-string parameter
     *
     * @param href location
     */
    cacheBustHref(href) {
        const augmentedHref = (href.indexOf('?') === -1)
            ? `${href}?faviconCacheBust=${Date.now()}`
            : `${href}&faviconCacheBust=${Date.now()}`;
        return (augmentedHref);
    }
    /**
     * I remove any favicon nodes that are not controlled by this service
     */
    removeExternalLinkElements() {
        // tslint:disable-next-line:prefer-const
        let linkElements = document.querySelectorAll(`link[ rel ~= 'icon' i]`);
        for (const linkElement of Array.from(linkElements)) {
            linkElement.parentNode.removeChild(linkElement);
        }
    }
    /**
     * Remove the favicon node from the document header
     */
    removeNode() {
        const linkElement = document.head.querySelector('#' + this.elementId);
        if (linkElement) {
            document.head.removeChild(linkElement);
        }
    }
    /**
     * Remove existing favicon node and inject a new favicon node with the give
     * elemet settings
     *
     * @param type type of favicon
     * @param href location
     */
    setNode(type, href) {
        const augmentedHref = this.useCacheBusting
            ? this.cacheBustHref(href)
            : href;
        this.removeNode();
        this.addNode(type, augmentedHref);
    }
}
BrowserFavicons.ctorParameters = () => [
    { type: undefined, decorators: [{ type: Inject, args: [BROWSER_FAVICONS_CONFIG,] }] }
];

// @dynamic
class ConvertToBase64Util {
    /**
     *
     * @param event either type File or Blob
     *
     * Converts to Base64 and returns an observable of Base64Model
     */
    static GetBase64(files) {
        const base64Observable = new Subject();
        const baseArray = [];
        let file;
        for (file of files) {
            const reader = new FileReader();
            // tslint:disable-next-line:no-shadowed-variable
            ((file) => {
                reader.onload = () => {
                    baseArray.push(new Base64Model(reader.result.toString(), file));
                    if (baseArray.length === files.length) {
                        base64Observable.next(baseArray);
                    }
                };
            })(file);
            reader.readAsDataURL(file['file'].rawFile);
            reader.onerror = (error) => {
                console.error('Error: ', error);
            };
        }
        return base64Observable;
    }
}

class ToggleThemeUtil {
    /**
     * Toggle fathym themes // could probably add themes to local storage
     *
     * @param classList classlist that holds the theme class
     *
     * @param val theme to change to
     */
    static Toggle(classList, val) {
        let theme;
        if (classList.contains('arctic-theme')) {
            classList.remove('arctic-theme');
        }
        if (classList.contains('contrast-theme')) {
            classList.remove('contrast-theme');
        }
        if (classList.contains('cool-candy-theme')) {
            classList.remove('cool-candy-theme');
        }
        if (classList.contains('flipper-theme')) {
            classList.remove('flipper-theme');
        }
        if (classList.contains('ice-theme')) {
            classList.remove('ice-theme');
        }
        if (classList.contains('sea-green-theme')) {
            classList.remove('sea-green-theme');
        }
        if (classList.contains('white-mint')) {
            classList.remove('white-mint');
        }
        switch (val.toUpperCase()) {
            case 'ARCTIC-THEME':
                theme = 'arctic-theme';
                classList.add('arctic-theme');
                break;
            case 'CONTRAST-THEME':
                theme = 'contrast-theme';
                classList.add('contrast-theme');
                break;
            case 'COOL-CANDY-THEME':
                theme = 'cool-candy-theme';
                classList.add('cool-candy-theme');
                break;
            case 'FLIPPER-THEME':
                theme = 'flipper-theme';
                classList.add('flipper-theme');
                break;
            case 'ICE-THEME':
                theme = 'ice-theme';
                classList.add('ice-theme');
                break;
            case 'SEA-GREEN-THEME':
                theme = 'sea-green-theme';
                classList.add('sea-green-theme');
                break;
            case 'WHITE-MINT-THEME':
                theme = 'white-mint-theme';
                classList.add('white-mint-theme');
                break;
        }
        return theme;
    }
}

